import React from 'react';
import { Sparklines, SparklinesLine } from 'react-sparklines';

const Chart = (props) => {

  return (
    <Sparklines height={150} width={50} data={props.data} >
      <SparklinesLine color={props.color} />
    </Sparklines>
  );
};

export default Chart;
